import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import '../css/presentation.css'; 

const Presentation = () => {

  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [tel, setTel] = useState('');
  const [ubicacion, setUbication] = useState('');
  const [image, setImage] = useState(null);
  const [ciudad, setCiudad] = useState('')
  const [userType, setUserType] = useState(''); // Nuevo estado para el tipo de usuario
  const navigate = useNavigate();
  
  const handleImageChange = (event) => {
    const selectedImage = event.target.files[0];
    setImage(URL.createObjectURL(selectedImage));
  };

  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const handleTelChange = (event) => {
    setTel(event.target.value);
  };

  const handleUbicationChange = (event) => {
    setUbication(event.target.value);
  };
  const handleCiudadChange = (event) => {
    setCiudad(event.target.value);
  };

  const  handleUserTypeSubmit = async (type) => {
    setUserType(type);
    try {
      const response = await fetch('/register', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          email,
          password,
          tel,
          ubicacion,
          ciudad,
          // Puedes añadir más campos aquí si es necesario
        }),
      });
      if (response.ok) {
        const data = await response.json();
        // Redirige al formulario adecuado basado en el tipo de usuario
        if (type === 'Proveedor') {
          navigate('/logprov');
        } else if (type === 'Comerciante') {
          navigate('/logcom');
        } else {
          console.error('Tipo de usuario no seleccionado');
        }
      } else {
        const errorData = await response.json();
        console.error('Error al registrar usuario:', errorData);
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };
  return (
    <div>
      <div className='Selperfil'>
        <input
          type="file"
          accept="images/*"
          onChange={handleImageChange}
          style={{ display: 'none' }}
          id="upload-file"
        />
        <label htmlFor="upload-file" className="upload-label">
          {image ? (
            <img src={image} alt="Profile" className="profile-image" />
          ) : (
            <div className='ImgPerf'>
              <p>Selecciona una imagen de perfil</p>
            </div>
          )}
        </label>
      </div>
  
      <div className='Form'>
        <form onSubmit={handleEmailSubmit}>
          <div className='email'>
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              value={email}
              onChange={handleEmailChange}
              required
            />
          </div>
          <div>
            <label htmlFor="password">Contraseña</label> 
            <input
              type="password"
              id="password"
              value={password}
              onChange={handlePasswordChange}
              required
            />
            <label htmlFor="tel">Teléfono</label> 
            <input
              type="tel"
              id="tel"
              value={tel}
              onChange={handleTelChange}
              required
            />
            <label htmlFor="ubicacion">Dirección</label> 
            <input
              type="text"
              id="ubicacion"
              value={ubicacion}
              onChange={handleUbicationChange}
              required
            />
            <label htmlFor="ciudad">Ciudad</label> 
            <input
              type="text"
              id="ciudad"
              value={ciudad}
              onChange={handleCiudadChange}
              required
            />
          </div>
          <h3>¿Qué se considera?</h3>
          <div className='ButtClass'>
           <button type="button" onClick={() => handleUserTypeSubmit('Proveedor')}>Proveedor</button>
           <button  type="button" onClick={() => handleUserTypeSubmit('Comerciante')}>Comerciante</button>
          </div>
          
        </form>
      </div>
      
      <div className='volver'><button type="submit"><Link to="/login">Volver</Link></button></div>
    </div>
  );
}

export default Presentation;
